import 'package:dorothy/model/logs.dart';
import 'package:dorothy/model/logs_handler.dart';
import 'package:get/get.dart';
const String dummyImage = '''''';

class LogsVM extends GetxController {
  late LogsHandler handler;

  
  @override
  void onInit() async {
    super.onInit();
    handler = LogsHandler();
    await addDummyLogs();
  }

  Future<List<Logs>> selectAllLogs() async {
    return handler.selectAllLogs();
  }

  Future<int> addDummyLogs() async {
    handler.insertLogs(dummyImage);
    return 0;
  }

  deleteLogs(int id) async {
    handler.deleteLogs(id);
  }
}